import React from 'react'
import Sidebar from '../Nav/Sidebar'
import Welcome from '../Sections/Welcome'
import PostSlider from '../Sections/PostSlider/PostSlider'

import styled from 'styled-components';

const Page = styled.div`
    @media (min-width: 48em) {
        max-width:80em;
    }   
    @media (min-width: 64em) {
        margin-left:auto;
        margin-right:auto;
    }    
`
const Sections = styled.div`
    margin:0;
    @media (min-width: 48em) {
        margin-left:calc(var(--sidebar-width));
        margin-right:calc(var(--sidebar-width));
    }  
    @media (min-width: 64em) {
    }      
`

export default function Home() {

    const data=[
        {
            id:'about',
            label:'About',
        },
        {
            id:'blog',
            label:'Blog',
        },
        {
            id:'photos',
            label:'Photos',
        },
    ]

    return (
        <Page>
            <Sections>
                <div id='about'><Welcome/></div>
                <div id='blog'><PostSlider key="blogSlider" category="blog"/></div>
                <div id='photos'><PostSlider key="photoSlider" category="photo"/></div>
            </Sections>
            <Sidebar data={data}/>
        </Page>
    )
}
